//Basic imports
import React from 'react';

//Styles imports
import styles from './new_comodo_sucess.styles';

//Components imports
import { View, Text } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import HeaderMain from '../../components/headerMain';
import LoginButton from '../../components/mainButton';
import VariantButton from '../../components/variantButton';
import RegisterButton from '../../components/textButton';

export default function NewComodoSucess() {

    const navigation: any = useNavigation();

    function handleNavigateToTabs() {
        navigation.navigate('ListProprietario');
    }

    return (
        <View style={styles.container}>
            <HeaderMain
                text='Cadastro Concluído'
            />
            <View style={styles.content}>
                <Text style={styles.title}>
                    Cômodo cadastrado com sucesso!
                </Text>
                <LoginButton
                    textBtn='Cadastrar outro Comodo'
                    onPress={() => navigation.navigate('NewComodo')}
                />
                <VariantButton
                    textBtn='Cadastrar componentes'
                    onPress={() => navigation.navigate('NewComponente')}
                />
            </View>
        </View>
    );
}
